  false,\n\t\"url\": null,\n\t\"notes\": \"This EnviroAtlas web service supports research
  and online mapping activities related to EnviroAtlas (https://www.epa.gov/enviroatlas).
  This EnviroAtlas dataset is a summary of key demographic groups for the Atlas Area.
  The purpose of this dataset is to highlight areas where the population is more vulnerable
  due to age or economic disadvantage. These populations may be at a higher risk for
  detrimental impacts to their well-being. Additional descriptive information about
  each attribute in this dataset can be found in its associated EnviroAtlas Fact Sheet
  (https://www.epa.gov/enviroatlas/enviroatlas-fact-sheets).\",\n\t\"license_title\":
